import { SnackbarService } from 'src/app/commons/service/snackbar.service';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Router } from '@angular/router';
import { Observable, throwError } from 'rxjs';
import { tap, catchError } from 'rxjs/operators';
import { UserLoginDto } from '../dto/userlogin-dto.model';
import { BaseHttpService } from './base-http.service';
import { LocalStoreService } from './jwt.service';
import { HEADER } from './service.constants';
import { JwtToken } from '../models/jwt-token.model';

@Injectable({
  providedIn: 'root',
})
export class AuthService extends BaseHttpService<UserLoginDto> {
  protected path: string = 'authenticate';

  constructor(
    httpClient: HttpClient,
    private jwtService: LocalStoreService,
    private router: Router,
    private snackbar: SnackbarService
  ) {
    super(httpClient);
  }

  public login$(userLoginDto: UserLoginDto): Observable<any> {
    const body = JSON.stringify(userLoginDto);
    const headers = new HttpHeaders(HEADER);

    const post$ = this.httpClient.post<JwtToken>(
      this.createBackendEndpoint(),
      body,
      {
        headers,
      }
    );

    return post$.pipe(
      catchError((err) => {
        this.snackbar.info({ text: 'Einloggen fehlgeschlagen!', typ: 'error' });
        this.jwtService.clear();
        return throwError(err);
      }),
      tap((resposne) => {
        this.jwtService.storeJwt(resposne);
        this.snackbar.info({ text: 'Du bist eingeloggt', typ: 'info' });
        this.router.navigateByUrl('/welcome');
      })
    );
  }
}

import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { environment } from 'src/environments/environment';
import { HEADER } from './service.constants';

@Injectable({
  providedIn: 'root',
})
export abstract class BaseHttpService<T> {
  protected path: string;
  protected httpClient: HttpClient;

  protected constructor(httpClient: HttpClient) {
    this.httpClient = httpClient;
  }

  public create$(dto: T): Observable<any> {
    const body = JSON.stringify(dto);
    const headers = new HttpHeaders(HEADER);
    return this.httpClient.post(this.createBackendEndpoint(), body, {
      headers,
    });
  }

  public createFromFormData$(formData: FormData): Observable<any> {
    return this.httpClient.post(this.createBackendEndpoint(), formData);
  }

  public getAll$(): Observable<T[]> {
    return this.httpClient.get<any>(this.createBackendEndpoint());
  }

  protected createBackendEndpoint(): string {
    return `${environment.BACKEND_URL}${this.path}`;
  }

  uploadImage$(file: File): Observable<any> {
    const formData = new FormData();
    formData.append('file', file, file.name);
    formData.append('id', '1');
    return this.httpClient.post(
      this.createBackendEndpoint() + '/image',
      formData
    );
  }
}

